import React from "react";
import { StyleSheet, Text, View } from "react-native";

const FlexboxScreen = () => {
    return (
    <View style={{ backgroundColor: "#2F363F", flex: 1, flexDirection: "column" }}>
        <View style={{ backgroundColor: "#F7F338", width: "100%", height: 50, flexDirection: "row-reverse",}} >
        <View style={{ backgroundColor: "green", width: "20%", height: 50,}}> </View>
        <View style={{ backgroundColor: "#36D116", width: "20%", height: 50, }}> </View>
            
</View>
    <View style={{ backgroundColor: "#EC2CC6", width: "100%", height: 75, flexDirection: "row" }}>
    <View style={{ backgroundColor: "#7D1969", width: "20%", height: 75 }}> </View>
    <View style={{ backgroundColor: "#4CB6EC", width: "20%", height: 75}}> </View>
    <View style={{ backgroundColor: "#DE4EF7", width: "20%", height: 75 }}> </View>
    <View style={{ backgroundColor: "#2D96CC", width: "20%", height: 75 }}> </View>
    <View style={{ backgroundColor: "#0F78DD", width: "20%", height: 75 }}> </View>
</View>
    <View style={{ backgroundColor: "#6DC706", width: "100%", height: 50 }}> </View>
    <View style={{ backgroundColor: "#0FDDD2", width: "100%", height: "40%" }}> </View>
    <View style={{ backgroundColor: "#6DC706", width: "100%", height: 50 }}> </View>
    <View style={{ backgroundColor: "#F7F338", width: "100%", height: "50%" }}> </View>
    <View style={{ backgroundColor: "#45B39D", width: "100%", height: "33%" , 
         flexDirection:"column" ,alignItems:"flex-end" }}>
    <View style={{ backgroundColor: "#76D7C4", width: "50%", height: "50%" }}></View>
    <View style={{ backgroundColor: "#D1F2EB", width: "50%", height: "50%" }}></View>
            
            </View>
</View>

    );
};

export default FlexboxScreen;
const style = StyleSheet.create({});
